import "../css/signup.css";

import { useState } from "react";
import { Link } from "react-router-dom";

export const Signup = () => {
  let [Email, setEmail] = useState<string>("");
  let [Nickname, setNickname] = useState<string>("");
  let [Password, setPassword] = useState<string>("");
  let [PasswordCheck, setPasswordCheck] = useState<string>("");

  return (
    <div className="page signup_page">
      <div className="signup_container">
        {/* 로그인 헤더 */}
        <header className="signup_header">
          <span>PWF</span>
        </header>
        {/* 로그인 내용 */}
        <div className="signup_content">
          <form action="post">
            <input
              type="email"
              spellCheck={false}
              placeholder="이메일"
              value={Email}
            />
            <input type="text" placeholder="닉네임" spellCheck={false} />
            <input type="password" placeholder="비밀번호" />
            <input type="password" placeholder="비밀번호 확인" />
            <button>회원가입</button>
          </form>
        </div>
        {/* 로그인 풋터 */}
        <footer className="signup_footer">
          <span>계정이 있다면?</span>
          <Link to="/login" className="login_anchor">
            로그인
          </Link>
        </footer>
      </div>
    </div>
  );
};
